import React from 'react';
import PropTypes from 'prop-types';
import Star from './Star'

function Stars({count}) {
  return (
    <ul>
    {count.map(count => <Star count={count} />)}
    </ul>
    );
  
}

export default Stars;

Stars.PropTypes ={
    count: PropTypes.number
};
